#mkb {
	position: relative;
	width: 656px;
	height: 210px;
	border-radius: 10px;
	border: 2px solid #398fc7;
	padding: 15px;
	margin-bottom: 30px;
	background: #398fc7;
}
.mkb_row{ width: 100%; position: relative} 
.hr_blue {
	border-bottom: 2px solid #64a5b9;
	height: 40px;
	margin: 0 0 25px;
	padding: 20px 0;
}
.mkb_logo{ float: left; height: auto}
.mkb_otpr {
	font-size: 20px;
	color: #fff;
	float: left;
	height: 20px;
	line-height: 18px;
	padding: 12px 40px 10px 0px;
}
.mkb_yes {
	background: #5eb965;
	cursor: pointer;
	border: 1px solid #5eb965;
	float: left;
	padding: 10px 20px;
	width: 70px;
	height: 20px;
	color: #fff;
	text-align: center;
	font-size: 20px;
	border-radius: 3px;
	line-height: 18px;
	margin-right: 20px;
}
.mkb_no {
	background: none;
	float: left;
	padding: 10px 20px;
	border: 1px solid #fff;
	width: 70px;
	height: 20px;
	cursor: pointer;
	color: #fff;
	text-align: center;
	font-size: 17px;
	border-radius: 3px;
	line-height: 18px;
}
.mkb_item {
	text-transform: uppercase;
	float: left;
	color: #ecf268;
	width: 215px;
	margin: 0;
	text-align:center;
}
.mkb_titl{font-size: 11px;}
.mkb_val{font-size: 19px;font-weight: bold}	

