 <h1 class="zagol">Последствия невыплаты кредита</h1>
 <p class="posledstv">В случае невозвращения общей суммы кредита, кредитор вынуждено начислит штраф за просрочку кредита. Большинство кредиторов идут на уступки и дают дополнительные 3 рабочих дня для оплаты. Они предусмотрены специально для Вас на случай, к примеру, если банковский перевод занял больше времени, чем обычно, или Вы просто поздно отправили сумму. Однако, в случае неполучения от Вас какой-либо реакции в течение продолжительного времени, будет начислен штраф за просрочку срока погашения кредита размером в среднем 0,10% от первоначальной суммы кредита, данные о Вас могут быть переданы в реестр должников, а задолженность коллекторскому агентству для взыскания долга.</p>
 
 <p class="posledstv">О всех приближающихся сроках платежа, кредитор своевременно информируем Вас по СМС и электронной рассылкой писем. Рекомендуем Вам вносить платеж в день получения данных напоминаний. Так, Вы сохраните репутацию добросовестного заемщика и сможете получить скидки при последующем обращении в организацию.</p>
 
 <p class="posledstv">Предложение не является оффертой. Конечные условия уточняйте при прямом общении с кредиторами.</p>
      
 <p class="posledstv">Процентная ставка по потребительским кредитам и кредитным картам - от 7,77% до 31% годовых.
     Например, если вы взяли кредит на сумму 100 000 рублей на 1 год, то после истечения срока кредита,
     вам необходимо будет выплатить: от 112 900 до 131 000 рублей.
  </p> 
