 $('input[name=summ], input[name=summ_doh]').bind("change keyup input click", function() {
    if (this.value.match(/[^0-9]/g)) {
        this.value = this.value.replace(/[^0-9]/g, '');
    }
 }); 
 
 $('input[name=passportNumber]').mask('0000-000000');
