 $('input[name=telefo]').mask('+7(000)000-00-00');
 
 $('input[name=email]').bind("change keyup input click", function() {
  this.value = this.value.replace(/\s+/g, '');
 });  
 
 //---------------------------------------------------------------------------
//Подсказки на поля ввода + автозаполнение кем выдан паспорт и адреса работы
  $("input[name=passportCode]").on("keyup", function(){
    if ($(this).val().length > 6) {
      $.ajax({
          url: 'https://robotseverovostok.ru/dev.php/pcode/'+$(this).val(),
          success: function(data){
              $("input[name=kem_vidan]").val(data);
          },
          error: function(data){
              console.log(data);
          }
      });
    }
  });
  if ($(window).width() >= 600) {
	  $("input[name=email]").suggestions({
		serviceUrl: "https://suggestions.dadata.ru/suggestions/api/4_1/rs",
		token: "76af43fb2643b4cc1d8c2a753eb56a8728f2dc89",
		type: "EMAIL",
		mobileWidth: 0,
		suggest_local: false,
		count: 5,
		autoSelectFirst: true
	  });
	
	  $("input[name=fio]").suggestions({
		serviceUrl: "https://suggestions.dadata.ru/suggestions/api/4_1/rs",
		token: "76af43fb2643b4cc1d8c2a753eb56a8728f2dc89",
		type: "NAME",
		mobileWidth: 0,
		count: 5,
		autoSelectFirst: true
	  }); 
  }

  if ($(window).width() >= 600) {
    $("input[name=name_org]").suggestions({
        serviceUrl: "https://suggestions.dadata.ru/suggestions/api/4_1/rs",
        token: "76af43fb2643b4cc1d8c2a753eb56a8728f2dc89",
        type: "PARTY",
        count: 5,
	      mobileWidth: 0,
        autoSelectFirst: true,
        /* Вызывается, когда пользователь выбирает одну из подсказок */
        onSelect: function(suggestion) {
          $("input[name=adress_org]").val(suggestion.data.address.value);
        }
    });
  }
  
  function join(arr /*, separator */
    ) {
        var separator = arguments.length > 1 ? arguments[1] : ", ";
        return arr.filter(function(n) {
            return n
        }).join(separator);
    }

    function makeRegionString(address) {
        return join([address.region]);
    }
    function formatRegionSelected(suggestion) {
        return makeRegionString(suggestion.data);
    }

    $("#regionSpent").suggestions({
        serviceUrl: "https://suggestions.dadata.ru/suggestions/api/4_1/rs",
        token: "76af43fb2643b4cc1d8c2a753eb56a8728f2dc89",
        type: "ADDRESS",
        hint: false,
        bounds: "region",
        autoSelectFirst: true,
        addon: 'none',
		mobileWidth: 0,
        formatSelected: formatRegionSelected,
        onSelect: function(suggestion) {
            $(".addr").show();
            document.getElementById('citySpent').focus();
            document.getElementById('citySpent').selectionStart = 0;
        }
    });
	//$("#regionSpent").suggestions().fixData();
	
	function makeCityString(address) {
        return join([(address.city !== address.region && address.city || ""), address.settlement]);
    }
    function formatCitySelected(suggestion) {
        return makeCityString(suggestion.data);
    }
    $("#citySpent").suggestions({
        serviceUrl: "https://suggestions.dadata.ru/suggestions/api/4_1/rs",
        token: "76af43fb2643b4cc1d8c2a753eb56a8728f2dc89",
        type: "ADDRESS",
        hint: false,
        bounds: "city-settlement",
        autoSelectFirst: true,
        addon: 'none',
		mobileWidth: 0,
        formatSelected: formatCitySelected,
        constraints: $("#regionSpent"),
        onSelect: function(suggestion) {
            document.getElementById('streetSpent').focus();
            document.getElementById('streetSpent').selectionStart = 0;
        }
    });
    //$("#citySpent").suggestions().fixData();

    function makeStreetString(address) {
        return join([address.street]);
    }
    function formatStreetSelected(suggestion) {
        return makeStreetString(suggestion.data);
    }
    $("#streetSpent").suggestions({
        serviceUrl: "https://suggestions.dadata.ru/suggestions/api/4_1/rs",
        token: "76af43fb2643b4cc1d8c2a753eb56a8728f2dc89",
        type: "ADDRESS",
        hint: false,
        bounds: "street",
        autoSelectFirst: true,
        addon: 'none',
		mobileWidth: 0,
        formatSelected: formatStreetSelected,
        constraints: $("#citySpent"),
        onSelect: function(suggestion) {
            document.getElementById('houseSpent').focus();
            document.getElementById('houseSpent').selectionStart = 0;
        }
    });
	

    function makeHouseString(address) {
        return join([join([address.house, address.block_type, address.block], " ")]);
    }
    function formatHouseSelected(suggestion) {
        return makeHouseString(suggestion.data);
    }
    $("#houseSpent").suggestions({
        serviceUrl: "https://suggestions.dadata.ru/suggestions/api/4_1/rs",
        token: "76af43fb2643b4cc1d8c2a753eb56a8728f2dc89",
        type: "ADDRESS",
        hint: false,
        bounds: "house",
        autoSelectFirst: true,
        addon: 'none',
		mobileWidth: 0,
        formatSelected: formatHouseSelected,
        constraints: $("#streetSpent"),
        onSelect: function(suggestion) {
            document.getElementById('flatSpent').focus();
            document.getElementById('flatSpent').selectionStart = 0;
        }
    });
		
	function dadata_usr(region_p) {
			alert(region_p);
			$("#citySpent").suggestions({
				serviceUrl: "https://suggestions.dadata.ru/suggestions/api/4_1/rs",
