				type: "ADDRESS",
				hint: false,
				bounds: "city-settlement",
				autoSelectFirst: true,
				addon: 'none',
				mobileWidth: 0,
				formatSelected: formatCitySelected,
				constraints: {
				  label: "",
				  // ограничиваем поиск 
