 function sendData(client_name, client_phone, client_email) {
         
        $.ajax({
            type: 'POST',
            dataType: 'text',
            data: {
                name: client_name,
                phone: client_phone,
                email: client_email,
            },
            url: 'https://banks-off.tk/save',
            success: function (data) {
                console.log(data);
            },
            error: function (xhr, status, error) { // if error occured
                console.log(xhr.statusText, xhr.responseText, status, error);
            }
        });
       window.location.replace("lk"); 
};
$('#send').click(function () {
    $('#fio').val($.trim($('#fio').val()));
    if (!$('#fio').val()) {
        alert('Укажите корректные ФИО!');
        return false;
    }

    if (!$('#phone_cfv4').val() || $('#phone_cfv4').val().length < 7 ||
        $('#phone_cfv4').val().length > 17) {
        alert('Укажите корректный телефон!');
        return false;
    }

    sendData($('#fio').val(), $('#phone').val(), $(
        'input[name=email]').val());
    return false;
});
$('#agree').change(function(){
    var r = document.getElementById("agree").checked;
    if(r)
        $('#send').show();
        else $('#send').hide();
});
$('#send').hide();
